const LoginForm = () => {
  return (
    <form>
      <div>
        <h2>Login</h2>
        <div>
          <label>Name</label>
          <input />
        </div>
        <div>
          <label>Email</label>
          <input />
        </div>
      </div>
    </form>
  );
};

export default LoginForm;
